void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;
        
        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
        
        *one_pixel_address = line_color;
}

void clear_FIFO()
{//clear keyboard FIFO
  volatile int * PS2_ptr = (int*) 0xFF200100;
  uint32_t PS2_data = *(PS2_ptr);
  uint16_t RVALID = 0;
  uint16_t RAVAIL = 0;
  do {
    // read the data register (the DATA byte is cleared)
    PS2_data = *(PS2_ptr);
    // get the number of available bytes from the RAVAIL part of data register
    RVALID = ((PS2_data & 0x8000) >> 15);
	RAVAIL = ((PS2_data & 0xFFFF0000) >> 16);
  } while (RVALID || (RAVAIL>0));
	PS2_data = *(PS2_ptr);
}

/*
 * once drawing into back buffer is done, wait for frame buffer render to finish
 * and front and back get swapped automatically
 */
void wait_for_vsync(){
	volatile int* pxl_ctrl_ptr = (int*) 0xff203020;
	int status;
	*pxl_ctrl_ptr = 1;//writing 1 into front buffer
	status= *(pxl_ctrl_ptr+3);//getting status register
	while((status & 0x1) != 0){
		status = *(pxl_ctrl_ptr+3);
	}//buffers have swapped
}

void clear_screen(){
	for(int x = 0; x < 320; x++){
		for(int y = 0; y < 240; y++){
			plot_pixel(x, y, 0x0);//black pixel	
		}
	}
}

void draw_line(int x1, int y1, int x2, int y2, short int line_color){
	if(x1 == x2){//if line is vertical
		if(y1 < y2){
			for(int i = y1; i <= y2; i++){
				plot_pixel(x1, i, line_color);	
			}
		}
		else{
			for(int i = y2; i <= y1; i++){
				plot_pixel(x1, i, line_color);	
			}
		}
	}
	else{
		double diffX = x2-x1; double diffY = y2-y1;
		double slope = diffY/diffX;
		if(slope >= 1 || slope <= -1){//if steep line
			if(y1 < y2){
				for(int i = y1; i <= y2; i++){
					int newX = ((i-y1)/slope)+x1;
					plot_pixel(newX, i, line_color);	
				}
			}
			else{
				for(int i = y2; i <= y1; i++){
					int newX = ((i-y2)/slope)+x2;
					plot_pixel(newX, i, line_color);	
				}
			}
		}
		else{//'flat' line
			if(x1 < x2){
				for(int i = x1; i <= x2; i++){
					int newY = slope*(i-x1) + y1;
					plot_pixel(i, newY, line_color);	
				}
			}
			else{
				for(int i = x2; i <= x1; i++){
					int newY = slope*(i-x2) + y2;
					plot_pixel(i, newY, line_color);	
				}
			}
		}
	}
}

void draw_box(int x, int y, int width, int height, short int color){
	for(int i = x; i < x + width; i++){
		for(int j = y; j < y + height; j++){
			plot_pixel(i, j, color);	
		}
	}
}

void draw_digit(int num, int x, int y, short int color) {
	for (int row = 0; row < DIGIT_HEIGHT; row++) {
        for (int col = 0; col < DIGIT_WIDTH; col++) {
            if (number_bitmaps[num][row] & (1 << (DIGIT_WIDTH - 1 - col))) {
                plot_pixel(x + col, y + row, color);
            }
        }
    }
}


void draw_score(int score, int x, int y, int end) {
	if(!end) draw_box(x, y, DIGIT_WIDTH*4, DIGIT_HEIGHT, 0x0);
	
    int digits = 0;
    int temp_score = score;

    // Calculate the number of digits in the score
    do {
        digits++;
        temp_score /= 10;
    } while (temp_score > 0);

    // Draw each digit of the score
    temp_score = score;
    for (int i = 0; i < digits; i++) {
        int digit = temp_score % 10;
        draw_digit(digit, x + (DIGIT_WIDTH + 1) * (digits - i), y, 0xFFFF); //white color
        temp_score /= 10;
    }
}

void draw_bitmap(const int bitmap[], int width, int height, int x, int y, short int color) {
    for (int row = 0; row < height; row++) {
        for (int col = 0; col < width; col++) {
            // Check if the current bit is set, indicating a pixel should be drawn
            if (bitmap[row] & (1 << (width - 1 - col))) {
                plot_pixel(x + col, y + row, color);
            }
        }
    }
}

void delay(int iterations) {
    /*for (int i = 0; i < iterations; i++) {
		//for(int i = 0; i < iterations; i++){
    	//Empty for delay
    }*/
	
	{
		// Converting time into milli_seconds
		int milli_seconds = 1000 * iterations;

		// Storing start time
		clock_t start_time = clock();

		// looping till required time is not achieved
		while (clock() < start_time + milli_seconds)
			;
	}
}

int clickSpace(){
	volatile int * PS2_ptr = (int *) 0xFF200100;
	int byte3;
	uint32_t PS2Data;
	uint16_t RVALID;
	PS2Data = *(PS2_ptr);
	RVALID = PS2Data & 0x8000;
	if(RVALID != 0){
		byte3 = (int)(PS2Data & 0xFF);
	}
	if(byte3 == 0x29){
		clear_FIFO();
		return 1;
	}
	return 0;
}


